import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from './serviceWorker';
import App from './App';
import Box from './Box';

ReactDOM.render(
  <React.StrictMode>
    <Box color="black" bg="blue">
      Blue Box
    </Box>
  </React.StrictMode>,
  document.getElementById('root')
);

serviceWorker.unregister();
